syntax = "proto3";

package bokura;

import "table_basic.proto";

message NormalHeroDungeonTableBase {
    int32 DungeonId = 1583;
    int32 SeasonOpenTime = 962;
    int32 AffixPool = 870;
    string Background = 343;
    int32 ModelId = 555;
    int32 EffectId = 1555;
    int32 BaseRatio = 1148;
    int32 LimitTime = 348;
    int_table ScoreRank = 741;
    int_array KeyReward = 1791;
}
message NormalHeroDungeonTableMgr {
    repeated bokura.NormalHeroDungeonTableMgr.DatasEntry datas = 1;
}
